function Souffle(t){if(this.options={duration:1e4,tick:1e3,recurring:null},"object"==typeof t)for(var i in t)this.options[i]=t[i]}Souffle.prototype.start=function(){this.beginning=new Date;var t=this;return this.interval=setInterval(function(){t.options.recurring&&t.options.recurring(),t.getTime()>=t.options.duration&&t.finish()},t.options.tick),this},Souffle.prototype.getTime=function(){return this.elapsed=new Date-this.beginning,this.elapsed},Souffle.prototype.pause=function(){return this.finish(),this},Souffle.prototype.unpause=function(){return this.options.duration-=this.elapsed,this.start(),this},Souffle.prototype.finish=function(){return clearInterval(this.interval),this.interval=void 0,this};